import React from "react";


// sfc is used to make component fucntion

//we used internal css in anchor tag

const Navbar = () => {
    return (  
        <nav className="navbar">
            <h1>Blog</h1>
            <div className="links">
                <a href="/">Home</a>
                <a href="/create" style={{
                    color:"white",
                    backgroundColor:"#f1356d",
                    borderRadius:"8px"
                }}>New Blog</a>
            </div>
        </nav>
    );
}

export default Navbar;
